import React, {Component} from "react"

class DashBoard extends Component{
    state={
        loading: true,
        tution: {}
    }   

    componentDidMount(){
        fetch("http://localhost:4000/dashboard")
            .then(response => response.json())
            .then(data => {
                this.setState({
                    tution : data
                })
            })
    }
    
    
    render(){
        return(
            <div>
            {this.state.tution.tution_id}
            </div>
        )
    }
}


export default DashBoard
